  `courseCreditsMax` float(5,2) unsigned DEFAULT NULL COMMENT 'Upper credit limit (used only if credits are variable)',
  `courseLecture` tinyint(4) DEFAULT NULL COMMENT 'Lecture hours',
  `courseLab` tinyint(4) DEFAULT NULL COMMENT 'Lab hours',
  `courseOther` tinyint(4) DEFAULT NULL COMMENT 'Other (out of class) hours',
  `courseDescription` text,
  `coursePrerequisite` varchar(255) DEFAULT '' COMMENT 'Prerequisite text',
  `courseCorequisite` varchar(255) DEFAULT '' COMMENT 'Corequisite text',
  `courseinstrtypeId` int(10) unsigned DEFAULT NULL,
  `courseMax` int(3) DEFAULT NULL,
  `courseInactive` int(1) NOT NULL DEFAULT '0' COMMENT 'Not currently used.',
  `ModifiedOn` datetime DEFAULT NULL,
  `ModifiedBy` int(11) unsigned DEFAULT NULL,
  PRIMARY KEY (`courseId`)
) ENGINE=InnoDB AUTO_INCREMENT=3133 DEFAULT CHARSET=latin1;
